supplyChain.globalScript:
distanceMatrix = {}
transitTimeMatrix = {}
var rate = function(rateInputObj) {

	this.evaluateByObj = function(dimObj) {
		result = this.evaluate(dimObj);
		if (!result || result.total <= 0 || !rateInputObj.baseRate.total
				|| rateInputObj.baseRate.total <= 0) {
			return 9999999;
		}
		return parseFloat(result.total);
	};

	this.evaluate = function(dimObj) {
		if (rateInputObj.accessorials) {
			for (i = 0; i < rateInputObj.accessorials.length; i++) {
				rateInputObj.accessorials[i].total = 0;
			}
		}
		this.evaluateBaseRate(dimObj);
		this.evaluateAccessorials(dimObj);
		this.evaluateStopOff(dimObj.stopOffs);
		this.getDistanceSplit(dimObj);
		this.evaluateTransitTime(dimObj);
		totalAmt = 0;
		baseRateBasis = rateInputObj.baseRate.basis;
		supportedBasis = rateInputObj.baseRate.supportedBasis;
		if (rateInputObj.baseRate.total) {
			totalAmt = rateInputObj.baseRate.total;
		}
		if (rateInputObj.accessorials) {
			for (i = 0; i < rateInputObj.accessorials.length; i++) {
				if (rateInputObj.accessorials[i]
						&& rateInputObj.accessorials[i].total
						&& (baseRateBasis || rateInputObj.accessorials[i].supportedBasis)) {
					totalAmt = totalAmt + rateInputObj.accessorials[i].total;
				}
			}
		}
		if (rateInputObj.stopBands && rateInputObj.stopOffTotal) {
			totalAmt = totalAmt + rateInputObj.stopOffTotal;
		}
		if (constraints && constraints.locationactivities) {
			this.evaluateActivityCost(constraints.locationactivities, dimObj);
		}
		if (rateInputObj.activityCost) {
			totalAmt = totalAmt + rateInputObj.activityCost;
		}
		rateInputObj.total = parseFloat(totalAmt);
		return rateInputObj;
	};
	
	
	this.evaluateActivityCost = function(locationactivities, dimObj) {
		var cost = 0.0;
		if(locationactivities){
			var keys = Object.keys(locationactivities);
			keys.forEach(function(key){
				 if ( dimObj.stopOffs.length > 1 ) {
                    // handle multi pick and multidrop cases 
                    for (j = 0; j < dimObj.stopOffs.length ; j++) {
                    	 var stop = dimObj.stopOffs[j].stop;
                    	 if ( stop.split('__')[1].split('_')[0] == 'HOLD') { //HOLD REQUIREMENT
                    		 if ( key == stop.slice(0, stop.indexOf('__'))){
                          	   for(var i = 0; i< constraints.locationactivities[stop.slice(0, stop.indexOf('__'))].SENDINGACTIVITIES.length; i++) {
                              	   cost = cost + calculateActivityCost(constraints.locationactivities[stop.slice(0, stop.indexOf('__'))].SENDINGACTIVITIES[i], dimObj);
                                 }
                             }
                    	 }else { // END REQUIREMENT
                    		 if ( key == stop.slice(0, stop.indexOf('__'))){
                          	   for(var i = 0; i< constraints.locationactivities[stop.slice(0, stop.indexOf('__'))].RECEIVINGACTIVITIES.length; i++) {
                              	   cost = cost + calculateActivityCost(constraints.locationactivities[stop.slice(0, stop.indexOf('__'))].RECEIVINGACTIVITIES[i], dimObj);
                          	   }
                             }
                    	 }
                    }
              }
		    });
			rateInputObj.activityCost = parseFloat(cost);
		}
		return rateInputObj.activityCost;
	};
	
	calculateActivityCost = function(activity, dimObj) {
		var totalActivityCost = 0.0;
		inputObj = rateInputObj.baseRate;
		if((activity.NAME && activity.ISDEFAULT && activity.COST && activity.COSTBASIS && activity.COSTCURRENCY) && 
		   ((activity.SHIPPING && activity.SHIPPING == true) ||(activity.RECEIEVING && activity.RECEIEVING == true))) {
			
			var costBasis = activity.COSTBASIS.replace(/"/g, "");
			var activityCost = parseFloat(activity.COST)
			if (costBasis == '/CBM') {
				if (dimObj.dims.volInCBM && activity.VOLCONVRATE) {
					var volume = dimObj.dims.volInCBM;
					totalActivityCost = (volume * activity.VOLCONVRATE) * activityCost;
				}
			} else if (costBasis == '/KG' || costBasis == '/LB'	|| costBasis == '/METRICTON') {
				if (dimObj.dims.wtInKG && activity.WTCONVRATE) {
					var weight = dimObj.dims.wtInKG;
					totalActivityCost = weight * (activity.WTCONVRATE * activityCost);
				}
			} else if (costBasis == '/FLAT') {
				totalActivityCost = activityCost;
			}
		}
		return totalActivityCost;
   };
	
	this.evaluateSMCRate = function(dimObj) {
		lbConvRate = rateInputObj.baseRate.lbConvRate;
		smcWeight = dimObj.dims.wtInKG * lbConvRate;
		smcRate = 0.0;
		smcDiscount = 0.0;
		smcFinalPrice = 0.0;
		
		if (inputObj.isdeficitpricing && inputObj.isdeficitpricing === 'yes') {
			if (rateInputObj.rateBands
					&& rateInputObj.rateBands.length > 0) {
				for (i = 0; i < rateInputObj.rateBands.length; i++) {
					found = false;
					if ((smcWeight > rateInputObj.rateBands[i].lowerbreak && !rateInputObj.rateBands[i].upperbreak)
							|| (smcWeight > rateInputObj.rateBands[i].lowerbreak && smcWeight <= rateInputObj.rateBands[i].upperbreak)) {
						found = true;					
					} else {
						if (i != 0 && smcWeight > rateInputObj.rateBands[i-1].upperbreak && smcWeight < rateInputObj.rateBands[i].lowerbreak) {
							found = true;				
						}
					}
					if (found) {
						if (rateInputObj.rateBands[i].upperbreak == 999999999) {
							smcRate = rateInputObj.rateBands[i].amount;
							smcDiscount = rateInputObj.rateBands[i].discountpercentage;
						} else {
							smcNextBandAmt = rateInputObj.rateBands[i + 1].amount;
							smcNextBandRate = smcNextBandAmt * dimObj.dims.wtInKG * 0.01;
							smcBandRate = rateInputObj.rateBands[i].amount * dimObj.dims.wtInKG * 0.01;
									
							if (smcNextBandRate > smcBandRate) {
								smcRate = rateInputObj.rateBands[i+1].amount;
								smcDiscount = rateInputObj.rateBands[i+1].discountpercentage;
							} else {
								smcRate = rateInputObj.rateBands[i].amount;
								smcDiscount = rateInputObj.rateBands[i].discountpercentage;
							}
						}
						break;
					}
				}
			}
		} else {
			if (rateInputObj.rateBands && rateInputObj.rateBands.length > 0) {
				for (i = 0; i < rateInputObj.rateBands.length; i++) {
					found = false;
					if ((smcWeight > rateInputObj.rateBands[i].lowerbreak && !rateInputObj.rateBands[i].upperbreak)
						|| (smcWeight > rateInputObj.rateBands[i].lowerbreak && smcWeight <= rateInputObj.rateBands[i].upperbreak)) {
						found = true;					
					} else {
						if (i != 0 && smcWeight > rateInputObj.rateBands[i-1].upperbreak && smcWeight < rateInputObj.rateBands[i].lowerbreak) {
							found = true;				
						}
					}
					if (found) {
							smcRate = rateInputObj.rateBands[i].amount;
							smcDiscount = rateInputObj.rateBands[i].discountpercentage;
							break;
					}
				}
			}		
		}		
		
		if (smcRate > 0.0) {
			noOfCwts = dimObj.dims.wtInKG * 0.01;
			grossCharge = noOfCwts * smcRate;
			discountedCharge = 0.0;
			
			if (smcDiscount > 0.0) {
				discountCharge = (grossCharge * smcDiscount) / 100;
				discountedCharge = grossCharge - discountCharge;				
			} else {
				discountedCharge = grossCharge;
			}
			
			minimumcharge = rateInputObj.baseRate.minimumcharge;
			minimumchargediscount = rateInputObj.baseRate.minimumchargediscount;
			discountedMinimumCharge = 0.0;
			
			if (minimumchargediscount > 0.0) {
				minimumdiscountCharge = (minimumcharge * minimumchargediscount) / 100;
				discountedMinimumCharge = minimumcharge - minimumdiscountCharge;				
			} else {
				discountedMinimumCharge = minimumcharge;
			}
			
			smcTotalPrice = (discountedCharge > discountedMinimumCharge) ? discountedCharge : discountedMinimumCharge;
			
			ltlsurchargepercentage = rateInputObj.baseRate.ltlsurchargepercentage;
			ltlsurchargeamount = (smcTotalPrice * ltlsurchargepercentage) / 100;
			
			smcCalculatedPrice = smcTotalPrice + ltlsurchargeamount;
			
			minimumfloorcharge = rateInputObj.baseRate.minimumfloorcharge;
			
			smcFinalPrice = (minimumfloorcharge > smcCalculatedPrice) ? minimumfloorcharge : smcCalculatedPrice;			
		} 
		
		rateInputObj.baseRate.supportedBasis = true;
		rateInputObj.baseRate.total = parseFloat(smcFinalPrice);
	};

	this.evaluateBaseRate = function(dimObj) {
		inputObj = rateInputObj.baseRate;
		calculateCW = rateInputObj.calculateCW;
		supportedBasis = false;
		totalAmt = 0;
		quantity = 0;
		
		if (inputObj.isSMC) {
			this.evaluateSMCRate(dimObj);
			return;				
		}
		
		if (inputObj.basis === '/container') {
			supportedBasis = true;
			if (inputObj.equipmentType && dimObj.dims[inputObj.equipmentType]) {
				totalAmt = inputObj.amount
						* dimObj.dims[inputObj.equipmentType];
				quantity = dimObj.dims[inputObj.equipmentType];
			} else {
				return;
			}
		}

		if (inputObj.basis === '/package' || inputObj.basis === '/pallet'
				|| inputObj.basis === '/unit' || inputObj.basis === '/carton'
				|| inputObj.basis === '/LNM' || inputObj.basis === '/SQM'
				|| inputObj.basis === '/MBF' || inputObj.basis === '/MSF'
				|| inputObj.basis === '/LDM') {
			supportedBasis = true;

			if (dimObj.dims.genericQty && dimObj.dims.genericQtyUnit
					&& (dimObj.dims.genericQtyUnit === inputObj.basis)) {
				genericqty = dimObj.dims.genericQty;
				if (inputObj.minimumqty) {
					rateInputObj.baseRate.appliedMinQty = inputObj.minimumqty > dimObj.dims.genericQty ? inputObj.minimumqty : 0;
					genericqty = inputObj.minimumqty > dimObj.dims.genericQty ? inputObj.minimumqty
							: dimObj.dims.genericQty;							
				}
				totalAmt = inputObj.amount * genericqty;
				quantity = genericqty;
			} else if (dimObj.dims[inputObj.basis]) {
				genericqty = dimObj.dims[inputObj.basis];
				if (inputObj.minimumqty) {
					rateInputObj.baseRate.appliedMinQty = inputObj.minimumqty > dimObj.dims.genericQty ? inputObj.minimumqty : 0;
					genericqty = inputObj.minimumqty > dimObj.dims.genericQty ? inputObj.minimumqty
							: dimObj.dims.genericQty;
				}
				totalAmt = inputObj.amount * genericqty;
				quantity = genericqty;
			}
		}

		if (inputObj.amount && inputObj.basis == '/FLAT') {
			supportedBasis = true;
			totalAmt = inputObj.amount;
			quantity = 1;
		}
		
		if (inputObj.amount && inputObj.basis == 'lps') {
			supportedBasis = true;
			totalAmt = inputObj.amount;
			quantity = 1;
	    }
	    
		if (dimObj.dims.wtInKG && inputObj.wtConvRate) {
			supportedBasis = true;
			weight = dimObj.dims.wtInKG;

			// GTN-25018 : Chargeable Weight scenario.
			volume = dimObj.dims.volInCBM;
			dimFactor = rateInputObj.dimFactor;
			dimFactorConv = rateInputObj.dimFactorConv;

			volumetricWeight = 0.0;
			if (dimFactor > 0 && dimFactorConv && dimObj.dims.volInCBM) {
				if (dimFactorConv === 'cm/kg') {
					volumetricWeight = (volume * 1000000) / dimFactor;
				} else if (dimFactorConv === 'in/lb') {
					volumetricWeight = (volume * 61024) / dimFactor;
					volumetricWeight = volumetricWeight * 0.45359237;
			    }
			}
			
			weight = (weight * inputObj.wtConvRate) > (volumetricWeight  * inputObj.wtConvRate) ? weight
					: volumetricWeight;

			if (inputObj.minWeight) {
				inputObj.appliedMinWeight = weight < inputObj.minWeight ? inputObj.minWeight : 0;
				weight = weight < inputObj.minWeight ? inputObj.minWeight
						: weight;
				inputObj.wtConvRate = 1;
			}
			quantity = weight * inputObj.wtConvRate;
			totalAmt = this.evaluateRateBands(weight, inputObj.amount,
					inputObj.wtConvRate);
		}

		if (inputObj.amount && inputObj.basis == '/WM') {
			weight = dimObj.dims.wtInKG;
			volume = dimObj.dims.volInCBM;
			wmUnit = 0;
			supportedBasis = true;
			if (weight) {
				wmUnit = weight * inputObj.wtConvRate;
			}
			if (volume) {
				wmUnit = wmUnit > volume ? wmUnit : volume;
			}
			if (inputObj.minWeight) {
				rateInputObj.baseRate.appliedMinWeight = wmUnit < inputObj.minWeight ? inputObj.minWeight : 0;
				wmUnit = wmUnit < inputObj.minWeight ? inputObj.minWeight
						: wmUnit;
				inputObj.wtConvRate = 1;
			}
			totalAmt = inputObj.amount * wmUnit;
			quantity = wmUnit;
		}

		if (dimObj.dims.volInCBM && inputObj.volConvRate) {
			supportedBasis = true;
			volume = dimObj.dims.volInCBM;

			if (inputObj.minimumqty) {
				rateInputObj.baseRate.appliedMinQty = volume < inputObj.minimumqty ? inputObj.minimumqty : 0;				
				volume = volume < inputObj.minimumqty ? inputObj.minimumqty
						: volume;
				inputObj.volConvRate = 1;
			}
			tempAmt = this.evaluateRateBands(volume, inputObj.amount,
					inputObj.volConvRate);
			totalAmt = totalAmt > tempAmt ? totalAmt : tempAmt;						
			quantity = volume * inputObj.volConvRate;
			
		} else if ((dimObj.dims.dstInMile
				|| (dimObj.stopOffs && dimObj.stopOffs.length > 1) || rateInputObj.distance)
				&& inputObj.dstConvRate) {
			supportedBasis = true;
			distance = 0.0;
			if (dimObj.dims.dstInMile) {
				distance = dimObj.dims.dstInMile;
			} else if (dimObj.stopOffs && dimObj.stopOffs.length > 1) {
				distance = this.getEffectiveDistance(dimObj);
			} else {
				distance = rateInputObj.distance;
			}
			quantity = distance * inputObj.dstConvRate;
			totalAmt = this.evaluateRateBands(distance, inputObj.amount,
					inputObj.dstConvRate);
		}

		if (inputObj.basis === 'pricingbands') {
			supportedBasis = true;
			bandAmt = 0.0;
			mUnit = 0.0;
			convRate = 0.0;
			amount = 0.0;
			
			if (inputObj.isdeficitpricing) {
				if (inputObj.wtConvRate) {
					mUnit = dimObj.dims.wtInKG;
					convRate = inputObj.wtConvRate;
					
					// GTN-27410 : Chargeable Weight scenario for TL and LTL.
					volume = dimObj.dims.volInCBM;
					dimFactor = rateInputObj.dimFactor;
					dimFactorConv = rateInputObj.dimFactorConv;

					volumetricWeight = 0.0;
					if (dimFactor > 0 && dimFactorConv && dimObj.dims.volInCBM) {
						if (dimFactorConv === 'cm/kg') {
							volumetricWeight = (volume * 1000000) / dimFactor;
						} else if (dimFactorConv === 'in/lb') {
							volumetricWeight = (volume * 61024) / dimFactor;
							volumetricWeight = volumetricWeight * 0.45359237;
						}
					}

					mUnit = (mUnit * inputObj.wtConvRate) > (volumetricWeight * convRate) ? mUnit
							: volumetricWeight;

					if (inputObj.minWeight) {
						mUnit = mUnit < inputObj.minWeight ? inputObj.minWeight
								: mUnit;
						inputObj.wtConvRate = 1;
						convRate = 1;
					}
				} else if (inputObj.volConvRate) {
					mUnit = dimObj.dims.volInCBM;
					convRate = inputObj.volConvRate;
				} else if (inputObj.dstConvRate) {
					mUnit = dimObj.dims.dstInMile;
					convRate = inputObj.dstConvRate;
				} else {
					if (inputObj.weightbreakbasis
							&& (inputObj.weightbreakbasis === '/package'
									|| inputObj.weightbreakbasis === '/pallet'
									|| inputObj.weightbreakbasis === '/unit'
									|| inputObj.weightbreakbasis === '/carton'
									|| inputObj.weightbreakbasis === '/LNM'
									|| inputObj.weightbreakbasis === '/SQM'
									|| inputObj.weightbreakbasis === '/MBF'
									|| inputObj.weightbreakbasis === '/MSF' 
									|| inputObj.weightbreakbasis === '/LDM')) {
						if (dimObj.dims.genericQty
								&& dimObj.dims.genericQtyUnit
								&& (dimObj.dims.genericQtyUnit === inputObj.weightbreakbasis)) {
							mUnit = dimObj.dims.genericQty;
							convRate = 1;
						} else if (dimObj.dims[inputObj.weightbreakbasis]) {
							mUnit = dimObj.dims[inputObj.weightbreakbasis];
							convRate = 1;
						}
					}
				}

				if (inputObj.isdeficitpricing === 'yes') {
					if (rateInputObj.rateBands
							&& rateInputObj.rateBands.length > 0) {
						for (i = 0; i < rateInputObj.rateBands.length; i++) {
							found = false;
							if (((mUnit * convRate) >= rateInputObj.rateBands[i].lowerbreak && !rateInputObj.rateBands[i].upperbreak)
									|| ((mUnit * convRate) >= rateInputObj.rateBands[i].lowerbreak && (mUnit * convRate) <= rateInputObj.rateBands[i].upperbreak)) {
								found = true;					
							} else {
								if (i != 0 && (mUnit * convRate) > rateInputObj.rateBands[i-1].upperbreak && (mUnit * convRate) < rateInputObj.rateBands[i].lowerbreak) {
									found = true;				
								}
							}
							if (found) {
								if (rateInputObj.rateBands[i].upperbreak == 999999999) {
								    if (inputObj.weightbreakbasis == 'lps') {
										bandAmt = rateInputObj.rateBands[i].amount;
									} else {
										bandAmt = rateInputObj.rateBands[i].amount
											* mUnit * convRate;																
									}
									quantity = mUnit * convRate;										
									amount = rateInputObj.rateBands[i].actualCost;
								} else {
									if (inputObj.weightbreakbasis == 'lps') {
										bandAmt = rateInputObj.rateBands[i + 1].amount;
									} else {
										bandAmt = rateInputObj.rateBands[i + 1].amount
												* rateInputObj.rateBands[i + 1].lowerbreak
												* convRate;							
									}
									actualPrice = 0.0;
									if (inputObj.weightbreakbasis == 'lps') {
										actualPrice = rateInputObj.rateBands[i].amount;
									} else {
										actualPrice = rateInputObj.rateBands[i].amount
												* mUnit * convRate;						
									}
									
									if (bandAmt > actualPrice) {
										bandAmt = actualPrice;
										amount = rateInputObj.rateBands[i].actualCost;
									} else {
										amount = rateInputObj.rateBands[i + 1].actualCost;
									}
									quantity = mUnit * convRate;		
								}
								break;
							}
						}
					}
				} else {
					if (rateInputObj.rateBands
							&& rateInputObj.rateBands.length > 0) {
						for (i = 0; i < rateInputObj.rateBands.length; i++) {
							found = false;
							if (((mUnit * convRate) >= rateInputObj.rateBands[i].lowerbreak && !rateInputObj.rateBands[i].upperbreak)
									|| ((mUnit * convRate) >= rateInputObj.rateBands[i].lowerbreak && (mUnit * convRate) <= rateInputObj.rateBands[i].upperbreak)) {
								found = true;					
							} else {
								if (i != 0 && (mUnit * convRate) > rateInputObj.rateBands[i-1].upperbreak && (mUnit * convRate) < rateInputObj.rateBands[i].lowerbreak) {
									found = true;				
								}
							}
							if (found) {
								if (inputObj.weightbreakbasis == 'lps') {
									bandAmt = rateInputObj.rateBands[i].amount;
								} else {
									bandAmt = rateInputObj.rateBands[i].amount
										* mUnit * convRate;								
								}
								quantity = mUnit * convRate;
								amount = rateInputObj.rateBands[i].actualCost;
								break;
							}
						}
					}
				}
			}		
			
			rateInputObj.baseRate.actualCost = parseFloat(amount);
			totalAmt = bandAmt;
		}

		if (!supportedBasis) {
			switch (inputObj.basis) {
			case '/container':
			case '/CBM':
			case '/WM':
			case '/kg':
			case '/lb':
			case '/ton':
			case '/MI':
			case '/KM':
				rateInputObj.baseRate.supportedBasis = true;
				supportedBasis = true;
			}
		}

		if (!supportedBasis) {
			totalAmt = inputObj.amount;
			rateInputObj.baseRate.quantity = 1;
		}
		
		if (quantity) {
			rateInputObj.baseRate.quantity = quantity;
		}		

		if (inputObj.minAmount) {
			rateInputObj.baseRate.appliedMin = totalAmt < inputObj.minAmount ? inputObj.minAmount : 0;
			totalAmt = totalAmt < inputObj.minAmount ? inputObj.minAmount
					: totalAmt;
		}
		
		if (inputObj.maxAmount) {
			rateInputObj.baseRate.appliedMax = totalAmt > inputObj.maxAmount ? inputObj.maxAmount : 0;
			totalAmt = totalAmt > inputObj.maxAmount ? inputObj.maxAmount
					: totalAmt;
		}
	
		rateInputObj.baseRate.supportedBasis = supportedBasis;
		rateInputObj.baseRate.total = parseFloat(totalAmt);
	};

	this.getEffectiveDistance = function(dimObj) {
		distance = 0.0;
		var jsonBaseRate = rateInputObj.baseRate;
		var dtmLookUPFlag = rateInputObj.dtmlookupflag;
		for (i = 0; i < dimObj.stopOffs.length - 1; i++) {
			origStop = dimObj.stopOffs[i].stop;
			if (origStop.indexOf('__') > 0) {
				origStop = origStop.slice(0, origStop.indexOf('__'));
			}
			destStop = dimObj.stopOffs[i + 1].stop;
			if (destStop.indexOf('__') > 0) {
				destStop = destStop.slice(0, destStop.indexOf('__'));
			}
			if (origStop == destStop) {
				distance = distance + 0.01;
				continue;
			}
			if(!dtmLookUPFlag){
				if (!distanceMatrix[origStop]
						|| !distanceMatrix[origStop][destStop]) {
					if (rateInputObj.distance) {
						return rateInputObj.distance;
					} else {
						return 9999999;
					}
				}
				distval = distanceMatrix[origStop][destStop];
				distance = distance + distanceMatrix[origStop][destStop];
			} else {
				if(!parseFloat(dimObj.distanceMatrix[origStop+'-'+destStop])){
					if (rateInputObj.distance) {
						return rateInputObj.distance;
					} else {
						return 9999999;
					}
				}
				distval = parseFloat(dimObj.distanceMatrix[origStop+'-'+destStop]);
				distance = distance + parseFloat(dimObj.distanceMatrix[origStop+'-'+destStop]);
			}
		}
		return distance;
	};

	this.evaluateRateBands = function(totalDim, rateAmount, ConvRate) {
		totalBandAmt = 0.0;
		if (rateInputObj.rateBands && rateInputObj.rateBands.length > 0) {
			actualCost = 0.0;
			for (i = 0; i < rateInputObj.rateBands.length; i++) {
				found = false;
				if ((totalDim >= rateInputObj.rateBands[i].lowerbreak && !rateInputObj.rateBands[i].upperbreak)
						|| (totalDim >= rateInputObj.rateBands[i].lowerbreak && totalDim <= rateInputObj.rateBands[i].upperbreak)) {
					found = true;					
				} else {
					if (i != 0 && totalDim > rateInputObj.rateBands[i-1].upperbreak && totalDim < rateInputObj.rateBands[i].lowerbreak) {
						found = true;				
					}
				}
				if (found) {
					totalBandAmt = (rateInputObj.baseRate.basis === '/FLAT') ? rateInputObj.rateBands[i].amount
							: (rateInputObj.rateBands[i].amount * totalDim * ConvRate);
					actualCost = rateInputObj.rateBands[i].actualCost;
					break;
				}
			}
			if (totalBandAmt == 0 && rateInputObj.baseRate) {
				totalBandAmt = rateInputObj.baseRate.basis === '/kg' ? (rateInputObj.baseRate.amount
						* totalDim * ConvRate)
						: rateInputObj.baseRate.amount;
				actualCost = rateInputObj.baseRate.amount;
			}
			rateInputObj.baseRate.actualCost = actualCost;
		} else {
			totalBandAmt = (rateInputObj.baseRate.basis === '/FLAT') ? rateAmount
					: rateAmount * totalDim * ConvRate;
		}
		return parseFloat(totalBandAmt);
	};

	this.evaluateAccessorials = function(dimObj) {
		if (rateInputObj.accessorials) {
			for (var i = 0; i < rateInputObj.accessorials.length; i++) {
				if (rateInputObj.accessorials[i]) {
					accObj = rateInputObj.accessorials[i];
					
					if(dimObj.assignmentStart){
						if(accObj.expiryDate < dimObj.assignmentStart || accObj.effectiveDate > dimObj.assignmentStart){
							continue;
						}
					}
					quantity = 0;
					totalAmt = 0;
					if (accObj.basis === '/container') {
						if (rateInputObj.baseRate.equipmentType
								&& dimObj.dims[rateInputObj.baseRate.equipmentType]) {
							totalAmt = accObj.amount
									* dimObj.dims[rateInputObj.baseRate.equipmentType];
							quantity =  dimObj.dims[rateInputObj.baseRate.equipmentType];
						} else {
							rateInputObj.accessorials[i].total = parseFloat(totalAmt);
							continue;
						}
					}

					if (accObj.basis === '%') {
						netfreightcostelems = rateInputObj.netfreightcostelems;
						if (netfreightcostelems
								&& netfreightcostelems.length > 0) {
							totalSurchargeAmount = 0;
							for (var j = 0; j < netfreightcostelems.length; j++) {
								netFreightSurcharge = netfreightcostelems[j];
								surchargeAmount = this.getSurchargeAmount(
										dimObj, netFreightSurcharge);
								totalSurchargeAmount = totalSurchargeAmount
										+ surchargeAmount;
							}

							baseRate = rateInputObj.baseRate.total;
							totalAmt = ((baseRate + totalSurchargeAmount) * accObj.amount) / 100;
						} else {
							baseRate = rateInputObj.baseRate.total;
							totalAmt = (baseRate * accObj.amount) / 100;
						}
					}

					if (accObj.basis === '/delivery'
							|| accObj.basis === '/entry'
							|| accObj.basis === '/shipment') {
						totalAmt = accObj.amount;
						quantity = 1;
					}

					if (accObj.basis === '/package'
							|| accObj.basis === '/pallet'
							|| accObj.basis === '/unit'
							|| accObj.basis === '/carton'
							|| accObj.basis === '/LNM'
							|| accObj.basis === '/SQM'
							|| accObj.basis === '/MSF'
							|| accObj.basis === '/MBF'
							|| accObj.basis === '/LDM') {
						if (dimObj.dims.genericQty
								&& dimObj.dims.genericQtyUnit
								&& (dimObj.dims.genericQtyUnit === accObj.basis)) {
							totalAmt = accObj.amount * dimObj.dims.genericQty;
							quantity = dimObj.dims.genericQty;
						} else if (dimObj.dims[accObj.basis]) {
							totalAmt = accObj.amount
									* dimObj.dims[accObj.basis];
						}
					}

					if (dimObj.dims.wtInKG && accObj.wtConvRate) {
						weight = dimObj.dims.wtInKG;

						// GTN-25018 : Chargeable Weight scenario.
						if (accObj.calculatedWeightBasis
								&& accObj.calculatedWeightBasis === 'Chargeable Weight') {
							dimFactor = rateInputObj.dimFactor;
							dimFactorConv = rateInputObj.dimFactorConv;

							volumetricWeight = 0.0;
							if (dimFactor > 0 && dimFactorConv
									&& dimObj.dims.volInCBM) {
								if (dimFactorConv === 'cm/kg') {
									volumetricWeight = (dimObj.dims.volInCBM * 1000000)
											/ dimFactor;
								} else if (dimFactorConv === 'in/lb') {
									volumetricWeight = (dimObj.dims.volInCBM * 61024)
											/ dimFactor;
									volumetricWeight = volumetricWeight * 0.45359237;
								}
							}
							weight = (weight * accObj.wtConvRate) > (volumetricWeight * accObj.wtConvRate) ? weight
									: volumetricWeight;
						}

						if (accObj.minWeight) {
							weight = weight < accObj.minWeight ? accObj.minWeight
									: weight;
						}
						totalAmt = accObj.amount * weight * accObj.wtConvRate;
						quantity = weight * accObj.wtConvRate;
					}
					if (dimObj.dims.volInCBM && accObj.volConvRate) {
						volume = dimObj.dims.volInCBM;
						if (accObj.minVolume) {
							volume = volume < accObj.minVolume ? accObj.minVolume
									: volume;
						}
						totalAmt = accObj.amount * volume * accObj.volConvRate;
						quantity = volume * accObj.volConvRate;
					}

					if ((dimObj.dims.dstInMile || (dimObj.stopOffs && dimObj.stopOffs.length > 1))
							&& accObj.dstConvRate) {
						distance = 0.0;
						if (dimObj.dims.dstInMile) {
							distance = dimObj.dims.dstInMile;
						} else {
							distance = this.getEffectiveDistance(dimObj);
						}
						totalAmt = accObj.amount * distance
								* accObj.dstConvRate;
						quantity = distance * accObj.dstConvRate;
					}

					if (accObj.basis == '/FLAT') {
						totalAmt = accObj.amount;
						quantity = 1;
					}
					
					if (accObj.basis == 'lps') {
						totalAmt = accObj.amount;
						quantity = 1;
					}
					
					if (accObj.amount && accObj.basis == '/WM') {
						weight = dimObj.dims.wtInKG;
						volume = dimObj.dims.volInCBM;
						wmUnit = 0;
						if (weight) {
							wmUnit = weight * accObj.wtConvRate;
						}
						if (volume) {
							wmUnit = wmUnit > volume ? wmUnit : volume;
						}
						totalAmt = accObj.amount * wmUnit;
						quantity = wmUnit;
					}

					if (rateInputObj.baseRate.basis == accObj.basis
							&& !rateInputObj.baseRate.supportedBasis) {
						totalAmt = accObj.amount;
						accObj.supportedBasis = true;
					} else if (rateInputObj.baseRate.basis != accObj.basis
							&& !rateInputObj.baseRate.supportedBasis) {
						totalAmt = 0;
					}

					if (accObj.minAmount) {
						rateInputObj.accessorials[i].appliedMin = totalAmt < accObj.minAmount ? accObj.minAmount : 0;
						totalAmt = totalAmt < accObj.minAmount ? accObj.minAmount
								: totalAmt;
					}
					if (accObj.maxAmount) {
						rateInputObj.accessorials[i].appliedMax = totalAmt > accObj.maxAmount ? accObj.maxAmount : 0;
						totalAmt = totalAmt > accObj.maxAmount ? accObj.maxAmount
								: totalAmt;
					}

					if (!dimObj.dims.isHazMat && accObj.isHazMat) {
						totalAmt = 0;
					}

					rateInputObj.accessorials[i].total = parseFloat(totalAmt);
					if (accObj.basis == '/stop') {
						rateInputObj.stopOffTotal = parseFloat(totalAmt);
						if(totalAmt && totalAmt >0) {
							rateInputObj.accessorials[i].quantity = 1;
						}
					} else{
						rateInputObj.accessorials[i].total = parseFloat(totalAmt);
						if(totalAmt && quantity) {
							rateInputObj.accessorials[i].quantity = quantity;
						}
					}
				}
			}
		}
	};

	this.getSurchargeAmount = function(dimObj, surcharge) {
		surchargeAmount = 0;
		inputObj = rateInputObj.baseRate;
		quantity = 0;
		if (surcharge.basis === '/container') {
			if (inputObj.equipmentType && dimObj.dims[inputObj.equipmentType]) {
				surchargeAmount = surcharge.amount
						* dimObj.dims[inputObj.equipmentType];
				quantity = dimObj.dims[inputObj.equipmentType];
			} else {
				quantity = 1;
				return surchargeAmount;
			}
		}

		if (surcharge.basis === '/delivery' || surcharge.basis === '/entry'
				|| surcharge.basis === '/shipment') {
			surchargeAmount = surcharge.amount;
			quantity = 1;
		}

		if (surcharge.basis === '/package' || surcharge.basis === '/pallet'
				|| surcharge.basis === '/unit' || surcharge.basis === '/carton'
				|| surcharge.basis === '/LNM' || surcharge.basis === '/SQM'
				|| surcharge.basis === '/MSF' || surcharge.basis === '/MBF'
				|| accObj.basis === '/LDM') {
			if (dimObj.dims.genericQty && dimObj.dims.genericQtyUnit
					&& (dimObj.dims.genericQtyUnit === surcharge.basis)) {
				surchargeAmount = surcharge.amount * dimObj.dims.genericQty;
				quantity = dimObj.dims.genericQty;
			} else if (dimObj.dims[surcharge.basis]) {
				surchargeAmount = surcharge.amount
						* dimObj.dims[surcharge.basis];
				quantity = dimObj.dims[surcharge.basis];
			}
		}

		if (surcharge.amount && surcharge.basis == '/FLAT') {
			surchargeAmount = surcharge.amount;
			quantity = 1;
		}

		if (dimObj.dims.wtInKG && surcharge.wtConvRate) {
			weight = dimObj.dims.wtInKG;
			// GTN-25018 : Chargeable Weight scenario.
			if (surcharge.calculatedWeightBasis
					&& surcharge.calculatedWeightBasis === 'Chargeable Weight') {
				dimFactor = rateInputObj.dimFactor;
				dimFactorConv = rateInputObj.dimFactorConv;
				volumetricWeight = 0.0;
				if (dimFactor > 0 && dimFactorConv && dimObj.dims.volInCBM) {
					if (dimFactorConv === 'cm/kg') {
						volumetricWeight = (dimObj.dims.volInCBM * 1000000)
								/ dimFactor;
					} else if (dimFactorConv === 'in/lb') {
						volumetricWeight = (dimObj.dims.volInCBM * 61024)
								/ dimFactor;
						volumetricWeight = volumetricWeight * 0.45359237;
					}
				}
				weight = (weight * surcharge.wtConvRate) > (volumetricWeight * surcharge.wtConvRate) ? weight
						: volumetricWeight;
			}
			if (surcharge.minWeight) {
				surcharge.appliedWeight = weight < surcharge.minWeight ? surcharge.minWeight : weight;
				weight = weight < surcharge.minWeight ? surcharge.minWeight
						: weight;
			}
			surchargeAmount = surcharge.amount * weight * surcharge.wtConvRate;
			quantity = weight * surcharge.wtConvRate;
		}

		if (dimObj.dims.volInCBM && surcharge.volConvRate) {
			volume = dimObj.dims.volInCBM;
			if (surcharge.minVolume) {
				surcharge.appliedVolume = volume < surcharge.minVolume ? surcharge.minVolume : volume;
				volume = volume < surcharge.minVolume ? surcharge.minVolume
						: volume;
			}
			surchargeAmount = surcharge.amount * volume * surcharge.volConvRate;
			quantity = volume * surcharge.volConvRate;
		}

		if (surcharge.amount && surcharge.basis == '/WM') {
			weight = dimObj.dims.wtInKG;
			volume = dimObj.dims.volInCBM;
			wmUnit = 0;
			if (weight) {
				wmUnit = weight * surcharge.wtConvRate;
			}
			if (volume) {
				wmUnit = wmUnit > volume ? wmUnit : volume;
			}
			if (surcharge.minWeight) {
				surcharge.appliedWeight = wmUnit < surcharge.minWeight ? surcharge.minWeight : wmUnit;
				wmUnit = wmUnit < surcharge.minWeight ? surcharge.minWeight
						: wmUnit;
				surcharge.wtConvRate = 1;
			}
			surchargeAmount = surcharge.amount * wmUnit;
			quantity = wmUnit;
		}

		if ((dimObj.dims.dstInMile || (dimObj.stopOffs && dimObj.stopOffs.length > 1))
				&& surcharge.dstConvRate) {
			if (surcharge.basis == '/stop') {
				surchargeAmount = surcharge.amount * dimObj.stopOffs.length
					* surcharge.dstConvRate;
				quantity = dimObj.stopOffs.length * surcharge.dstConvRate;
			} else {
				distance = 0.0;
				if (dimObj.dims.dstInMile) {
					distance = dimObj.dims.dstInMile;
				} else {
					distance = this.getEffectiveDistance(dimObj);
				}
				surchargeAmount = surcharge.amount * distance
						* surcharge.dstConvRate;
				quantity = distance * surcharge.dstConvRate;
			}
		}

		if (rateInputObj.baseRate.basis == inputObj.basis
				&& !rateInputObj.baseRate.supportedBasis) {
			surchargeAmount = surcharge.amount;
			surcharge.supportedBasis = true;
			rateInputObj.accessorials[i].quantity = quantity;
		} else if (rateInputObj.baseRate.basis != surcharge.basis
				&& !rateInputObj.baseRate.supportedBasis) {
			surchargeAmount = 0;
		}

		if (surcharge.minAmount) {
			surcharge.appliedMin = totalAmt < inputObj.minAmount ? inputObj.minAmount : 0;			
			surchargeAmount = surchargeAmount < surcharge.minAmount ? surcharge.minAmount
					: surchargeAmount;
		}
		if (surcharge.maxAmount) {
			surcharge.appliedMax = totalAmt > inputObj.maxAmount ? inputObj.maxAmount : 0;
			surchargeAmount = surchargeAmount > surcharge.maxAmount ? surcharge.maxAmount
					: surchargeAmount;
		}
		return surchargeAmount;
	}

	this.evaluateStopOff = function(stopOffs) {
		stopOffAmt = 0.0;
		if (rateInputObj.stopBands && stopOffs && stopOffs.length > 2) {
			numOfStopOffs = stopOffs.length - 2;
			remainingStopOffs = numOfStopOffs;
			previousEnd = 0;

			for (i = 0; i < rateInputObj.stopBands.length; i++) {
				start = rateInputObj.stopBands[i].start;
				end = rateInputObj.stopBands[i].stop;
				if (numOfStopOffs > end) {
					stopOffAmt = stopOffAmt
							+ (rateInputObj.stopBands[i].costPerStop * (end - previousEnd));
					remainingStopOffs -= (end - previousEnd);
					previousEnd = end;

				} else if (numOfStopOffs >= start && numOfStopOffs <= end) {
					stopOffAmt = stopOffAmt
							+ (rateInputObj.stopBands[i].costPerStop * remainingStopOffs);
					break;
				}
			}
			rateInputObj.stopOffTotal = parseFloat(stopOffAmt);
		}

	};
	
	this.getDistanceSplit = function(dimObj) {
		distance = 0.0;
		var distObj = [];
		var distArr = [];
		var jsonBaseRate = rateInputObj.baseRate;
		var dtmLookUPFlag = rateInputObj.dtmlookupflag;
		if(dimObj.stopOffs) {
			for (i = 0; i < dimObj.stopOffs.length - 1; i++) {
				origStop = dimObj.stopOffs[i].stop;
				if (origStop.indexOf('__') > 0) {
					origStop = origStop.slice(0, origStop.indexOf('__'));
				}
				destStop = dimObj.stopOffs[i + 1].stop;
				if (destStop.indexOf('__') > 0) {
					destStop = destStop.slice(0, destStop.indexOf('__'));
				}
				if (origStop == destStop) {
					distance = distance + 0.01;
					distObj = {Distance:distance, OrigStop:origStop, DestStop:destStop};
					distArr.push(distObj);
					continue;
				}
				if(!dtmLookUPFlag){
					if (!distanceMatrix[origStop]
							|| !distanceMatrix[origStop][destStop]) {
						if (rateInputObj.distance) {
							return rateInputObj.distance;
						} else {
							return 9999999;
						}
					}
					distval = distanceMatrix[origStop][destStop];
					distance = distance + distanceMatrix[origStop][destStop];
				} else{
					if(!parseFloat(dimObj.distanceMatrix[origStop+'-'+destStop])){
						if (rateInputObj.distance) {
							return rateInputObj.distance;
						} else {
							return 9999999;
						}
					}
					distval = parseFloat(dimObj.distanceMatrix[origStop+'-'+destStop]);
					distance = distance + parseFloat(dimObj.distanceMatrix[origStop+'-'+destStop]);
				}
				distObj = {Distance:distval, OrigStop:origStop, DestStop:destStop};
				distArr.push(distObj);
			}
		}
		jsonBaseRate["distArr"] = distArr;
		return jsonBaseRate;
	};
	
	this.evaluateTransitTime = function(dimObj) {
		transittime = 0.0;
		var dtmLookUPFlag = rateInputObj.dtmlookupflag;
		if (dimObj.stopOffs && dimObj.stopOffs.length > 1) {		
			if (dimObj.stopOffs && dimObj.stopOffs.length > 1) {
				for (i = 0; i < dimObj.stopOffs.length - 1; i++) {
					origStop = dimObj.stopOffs[i].stop;
					if (origStop.indexOf('__') > 0) {
						origStop = origStop.slice(0, origStop.indexOf('__'));
					}
					destStop = dimObj.stopOffs[i + 1].stop;
					if (destStop.indexOf('__') > 0) {
						destStop = destStop.slice(0, destStop.indexOf('__'));
					}
					if (origStop == destStop) {
						transittime = transittime + 0.01;
						continue;
					}
					if(!dtmLookUPFlag){
					if (!transitTimeMatrix[origStop]
							|| !transitTimeMatrix[origStop][destStop]) {
							transittime = parseFloat(9999999);
							break;
					}
						transittime = transittime + transitTimeMatrix[origStop][destStop];
					} else {
						if(!parseFloat(dimObj.transitTimeMatrix[origStop+'-'+destStop]) ){
							transittime = parseFloat(9999999);
							break;
						}
						transittime = transittime + parseFloat(dimObj.transitTimeMatrix[origStop+'-'+destStop]);
					}
				}
			} 
		}	
		rateInputObj.baseRate.transittime = parseFloat(transittime);		
